import React from "react";
import { withRouter, Link } from "react-router-dom";

function Intro() {
  return (
    <>
    <div className="fade">
      <div className="container">

        <Link to="/xmaspiano">
            <img src="logo.jpg" alt="Logo" width="50%">
            </img>
        </Link>
        </div>
      </div>
    </>
  );
}

export default withRouter(Intro);
